import './Navbar.css'
import iconcat from './component/pics/catIcon.png'
const Navbar = () => {
    return ( 
        <div className="Navbar">
            <div className='grid-container-element'>
                <div class="grid-child-element purple"><img src={iconcat} alt='error'/></div>
                <div class="grid-child-element green"><h1>喵喵喵？你是哪种流浪猫？</h1></div>

            </div>




        </div>
     );
}

export default Navbar;
